import React from "react";
import Carousel from 'react-bootstrap/Carousel';
import { carouselPicores } from '../data/carouselData';


function StarWarsCarousel() {

  return (
    <div className="main">
      <div className="main_text">


<p className="center">ЭПИЗОД НОВАЯ НАДЕЖДА ДЛЯ CSS3</p>

<p>Вам, вероятно, потребуется для регулировки движения, объема и сроков
в зависимости от количества текста, который вы хотите показать. 3D-глубина может
также изменениям в #заголовков декларации.</p>

<p>Весь код, содержащийся в этом один HTML-файл...</p>






      </div>

    <div className="main_carousel">
    <Carousel variant="dark" indicators={false} fade={true} controls={false} pause={'hover'} >
        {carouselPicores.map((element, key) => <Carousel.Item interval={800} key={key} > 
        <img className="b-block w-20" src={element.src}     alt={element.alt}  />
        </Carousel.Item>)
     } </Carousel>
    </div>

    </div>
  );
}

export default StarWarsCarousel;
